import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SensorList from './SensorList';
import OfflineSensors from './OfflineSensors';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/offline-sensors" element={<OfflineSensors />} />
          <Route path="/" element={<SensorList />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
